import React from 'react';
import { Navbar, Nav, Container, NavDropdown } from 'react-bootstrap';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext'; // Assuming you have an auth context
import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL || 'http://localhost:5005';

const NavbarComponent = () => {
  const { logout, user } = useAuth();
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      // Call logout API
      await axios.post(`${API_BASE_URL}/api/logout`, {}, { withCredentials: true });

      // Clear local auth state
      logout();

      // Redirect to login
      navigate('/login');
    } catch (error) {
      console.error('Logout failed:', error);
    }
  };

  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="mb-4">
      <Container>
        <Navbar.Brand as={Link} to="/">MOFSL API</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Dashboard</Nav.Link>
            <Nav.Link as={Link} to="/market-data">Market Data</Nav.Link>
            <NavDropdown title="Trading" id="trading-dropdown">
              <NavDropdown.Item as={Link} to="/orders">Orders</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/positions">Positions</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/holdings">Holdings</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link as={Link} to="/reports">Reports</Nav.Link>
          </Nav>

          <Nav>
            <NavDropdown 
              title={user?.client_id || "Account"} 
              id="account-dropdown" 
              align="end"
            >
              <NavDropdown.Item as={Link} to="/settings">Settings</NavDropdown.Item>
              <NavDropdown.Item as={Link} to="/profile">Profile</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item onClick={handleLogout}>Logout</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
